// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "../../interfaces/IAaveStake.sol";
import "../../interfaces/ISettings.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../openzeppelin/contracts/token/ERC20/SafeERC20.sol";



pragma experimental ABIEncoderV2;

contract AAVEStrategy is Ownable {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;

    struct Tokens {
        address token;
        address amToken;
    }

    IAaveStake public LendingPool;
    IAaveStake public Rewards;
    ISettings public Settings;

    address[] public tokens;
    address[] public aaveMarketTokens;

    mapping(address => address) public tokenToAm;

    mapping(address => uint256) public totalDeposits;

    mapping(address => mapping(address => uint256)) public vaultDeposits;

    uint256 public constant DEPOSIT_FEE_POINTS = 5;
    uint256 public constant DEPOSIT_FEE_BASE_POINTS = 1000;
    uint256 public constant FILLER_FEE_POINTS = 3;
    uint256 public constant FILLER_FEE_BASE_POINTS = 1000;
    uint256 public constant TX_FEE_POINTS = 2;
    uint256 public constant TX_FEE_BASE_POINTS = 1000;


    modifier onlyVault {
        require(Settings.vault(msg.sender), "CornFi AAVE Strategy: Vault Only Function");
      _;
   }


    constructor(IAaveStake _lendingPool, IAaveStake _rewards, ISettings _settings, Tokens[] memory _tokens) public {
        LendingPool = _lendingPool;
        Rewards = _rewards;
        Settings = _settings;
        for(uint i = 0; i < _tokens.length; i++) {
            _addToken(_tokens[i].token, _tokens[i].amToken);
        }
    }


    function depositFee(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.mul(DEPOSIT_FEE_POINTS).div(DEPOSIT_FEE_BASE_POINTS);
    }


    function txFee(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.mul(TX_FEE_POINTS).div(TX_FEE_BASE_POINTS);
    }


    function fillerFee(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.mul(FILLER_FEE_POINTS).div(FILLER_FEE_BASE_POINTS);
    }


    function addToken(Tokens memory _token) public onlyOwner {
        _addToken(_token.token, _token.amToken);
    }


    function _addToken(address _token, address _amToken) internal {
        tokenToAm[_token] = _amToken;
        tokens.push(_token);
        aaveMarketTokens.push(_amToken);
    }


    function deposit(address _from, address _token, uint256 _amount) public onlyVault {
        require(tokenToAm[_token] != address(0));
        if(_amount > 0) {
            IERC20(_token).transferFrom(_from, address(this), _amount);

            // Approve Aave lending pool to take (deposit) a token
            IERC20(_token).approve(address(LendingPool), _amount);

            // Deposit assets into Aave lending pool
            LendingPool.deposit(_token, _amount, address(this), uint16(0));

            totalDeposits[_token] = totalDeposits[_token].add(_amount);
            vaultDeposits[msg.sender][_token] = vaultDeposits[msg.sender][_token].add(_amount);
        }
    }


    function withdraw(address _from, address _token, uint256 _amount) public onlyVault {
        require(tokenToAm[_token] != address(0), "CornFi AAVE Strategy: Invalid Token");

        // This prevents the owner from creating a malicious vault that could withdraw all tokens
        require(_amount <= vaultDeposits[msg.sender][_token], "CornFi AAVE Strategy: Vault Withdraw Amount Exceeded");

        if(_amount > 0) {
            LendingPool.withdraw(_token, _amount, _from);
            totalDeposits[_token] = totalDeposits[_token].sub(_amount);
            vaultDeposits[msg.sender][_token] = vaultDeposits[msg.sender][_token].sub(_amount);
        }
    }


    function claimRewards() public onlyOwner {
        // Claim Aave WMATIC rewards, if any
        if(Rewards.getRewardsBalance(aaveMarketTokens, address(this)) > 0) {
            Rewards.claimRewards(aaveMarketTokens, uint256(-1), Settings.feeAddress());
        }

        uint256 interest;
        for(uint i = 0; i < tokens.length; i++) {
            interest = IERC20(tokenToAm[tokens[i]]).balanceOf(address(this)).sub(totalDeposits[tokens[i]]);
            if(interest > 0) {
                LendingPool.withdraw(tokens[i], interest, Settings.feeAddress());
            }
        }
    }
}
